{"size.height":"var size;

switch (Vecta.activePage.unit()) {
 case 'in':
 size = this.text() === '' ? 0.3 : Math.ceil((new Vecta.Length(this.textHeight()).in() + 0.25) / 0.25) * 0.25;
 (size < 0.3 ? 0.3 : size) + 'in';
 break;
 case 'cm': //2.4cm
 size = this.text() === '' ? 1 : Math.ceil((new Vecta.Length(this.textHeight()).cm() + 0.5) / 0.5) * 0.5;
 (size < 1 ? 1 : size) + 'cm';
 break;
 case 'mm': //24mm
 size = this.text() === '' ? 10 : Math.ceil((new Vecta.Length(this.textHeight()).mm() + 5) / 5) * 5;
 (size < 10 ? 10 : size) + 'mm';
 break;
 default:
 size = this.text() === '' ? 30 : Math.ceil((this.textHeight() + 10) / 10) * 10;
 size < 30 ? 30 : size;
}"}
